<script>
	import store from "@/store";
	import ApartmentsSelectedPlanS from "@/components/academ/ApartmentsPage/ApartmentsSelectedPlanS";
	import svgWork from "@/js/svgWork";

	export default {
		store,
		data() {
			return {
				sect: {
					type: Number,
				},
			};
		},
		components: { ApartmentsSelectedPlanS },
		props: {
			section: {
				type: Number,
			},
			apart: {
				type: Object,
			},
		},
		methods: {
			clickApart() {
				this.$emit("clickApart");
			},
			ApartIndex1(index) {
				this.$emit("boolFlat", false);
				this.$emit("ApartNumber1", index);
			},
			ApartIndex2(index) {
				this.$emit("boolFlat", false);
				this.$emit("ApartNumber2", index);
			},
			ApartIndex3(index) {
				this.$emit("boolFlat", false);
				this.$emit("ApartNumber3", index);
			},
			showModal(bool) {
				this.$emit("showModal", bool);
			},
			hideModal() {
				this.$emit("showModal", false);
			},
			drawSVG() {
				const one1 = document.querySelector(".section1S svg rect");

				one1.setAttribute("style", "pointer-events: all;");
				one1.addEventListener("click", () => {
					this.sect = 1;
					this.SelectSchem(".sectionn");
					this.$emit("section", this.sect);
					this.ApartIndex1(0);
				});

				const two1 = document.querySelector(".section2S svg rect");
				two1.setAttribute("style", "pointer-events: all;");
				two1.addEventListener("click", () => {
					this.sect = 2;
					this.SelectSchem(".section22");
					this.$emit("section", this.sect);
					this.ApartIndex2(0);
				});

				const three1 = document.querySelector(".section3S svg rect");
				three1.setAttribute("style", "pointer-events: all;");
				three1.addEventListener("click", () => {
					this.sect = 3;
					this.SelectSchem(".section33");
					this.$emit("section", this.sect);
					this.ApartIndex3(0);
				});

				let inputArr = [".section1S", ".section2S", ".section3S"];
				let resultArr = ["sectionn", "section22", "section33"];
				svgWork.SelectSVG(inputArr, resultArr);
			},
			SelectSchem(sect) {
				const section = document.querySelectorAll(sect);
				document.querySelectorAll(".sectionn").forEach((b) => {
					b.setAttribute("style", "fill: #CFD0D0");
				});
				document.querySelectorAll(".section22").forEach((b) => {
					b.setAttribute("style", "fill: #CFD0D0");
				});
				document.querySelectorAll(".section33").forEach((b) => {
					b.setAttribute("style", "fill: #CFD0D0");
				});
				section.forEach((b) => {
					b.setAttribute("style", "fill: #F6D6B9");
				});
			},
		},
		mounted() {
			// document.querySelector(".section1S").innerHTML =
			// 	store.getters.SECTION1;
			// document.querySelector(".section2S").innerHTML =
			// 	store.getters.SECTION2;
			// document.querySelector(".section3S").innerHTML =
			// 	store.getters.SECTION3;
			this.drawSVG();
			if (this.section === 1) this.SelectSchem(".sectionn");
			if (this.section === 2) this.SelectSchem(".section22");
			if (this.section === 3) this.SelectSchem(".section33");
			this.sect = this.section;
		},
	};
</script>

